import React from 'react';

const projects = [
  {
    title: 'Online Cake Order System',
    desc: 'Full-stack MERN application for ordering cakes with authentication, order management and admin dashboard.',
    tech: 'React, Node, Express, MongoDB',
    link: '#'
  },
  {
    title: 'Outpass Request Mobile App',
    desc: 'React Native app with AsyncStorage, history tracking and Express backend for student outpass requests.',
    tech: 'React Native, Express',
    link: '#'
  },
  {
    title: 'FoodGo – Food Ordering UI/UX Prototype',
    desc: 'Figma prototype showcasing a modern, intuitive food ordering experience and flows.',
    tech: 'Figma (UX/UI)',
    link: '#'
  },
  {
    title: 'SecureChat (Realtime Messenger)',
    desc: 'Real-time chat with optional message expiry, ghost mode and E2E encryption prototype using Socket.io.',
    tech: 'Node, Socket.io, React, MongoDB',
    link: '#'
  }
];

export default function Projects() {
  return (
    <div className="container projects-card">
      <h2>Projects</h2>
      <div className="projects-grid">
        {projects.map((p, i) => (
          <article key={i} className="project-card">
            <h3>{p.title}</h3>
            <p className="muted">{p.tech}</p>
            <p>{p.desc}</p>
            <div className="project-actions">
              <a className="btn btn-sm" href={p.link} target="_blank" rel="noreferrer">View</a>
            </div>
          </article>
        ))}
      </div>
      <p className="muted">Replace view links with GitHub repos or case study pages.</p>
    </div>
  );
}
